import React, { Component } from 'react'
import { FaRegCheckCircle } from 'react-icons/fa';

class Items extends Component {
    render() {
        return (
            <div className='item'>
                <img src={this.props.img} alt="most-popular" className='rounded-5'/>
                <div className='info d-flex gap-2'>
                    <img src={this.props.profile} alt="profile" />
                    <div className='details'>
                        <div className='name d-flex gap-1'>
                            <FaRegCheckCircle className='text-pink'/>
                            <span className='text-pink'>{this.props.name}</span>
                        </div>
                        <h4 className='text-white'>{this.props.title}</h4>
                    </div>
                </div>
            </div>
        )
    }
}


export default Items;
